import unittest
from unittest.mock import patch
import calculate

class TestCalculateAge(unittest.TestCase):
    @patch('calculate.isleap')
    def test_judge_leap_year(self, mock_isleap):
        # Mock the isleap function return values
        mock_isleap.side_effect = [True, False]

        # Test cases
        self.assertEqual(calculate.judge_leap_year(2000), True)
        self.assertEqual(calculate.judge_leap_year(1900), False)

        # Verify isleap function was called
        self.assertEqual(mock_isleap.call_count, 2)
        mock_isleap.assert_any_call(2000)
        mock_isleap.assert_any_call(1900)

